import '../Home.css';

const Story = ({ story }) => {
    const {
      title,
      url,
      author,
      num_comments,
      points,
      image,
    } = story;

    return (
      <div className='homePageContainer'>
        <div>
        <img src={image} className='bookImage'></img>
        <br></br>
        <span>
          <a href={url}>{title}</a>
        </span>
        <br></br>
        <div className='homePageText'>
            <span>{author}</span>
            <br></br>
            <span>{num_comments} comments</span>
            <br></br>
            <span>{points}</span>
        </div>
      </div>
      </div>  
    );
  }

  export default Story;
